import React, {Component} from 'react';

export default class FlowChart extends Component {
  render(){
    return (
      <div style={{height: '500px', backgroundColor: 'red', textAlign: 'center', color: 'yellow', fontSize: '20px'}}>
        Hello
      </div>
    )
  }
};
